import React from 'react'
import logo from './img/logo.jpeg';
import sre from './img/search.png';
import {Link} from '.reat-router-dom';

const Navbar = () => {
  return (
    <div className='Contarner'>

      <div className="nav1">
        <img src={logo} alt="" className="logo" />

        <div className="input">
        <img src={sre} alt="" className="inputimg" />
        <input type="text"  />
        </div>
        <Link className="btn">Find my book</Link>



      </div>






    </div>
  )
}

export default Navbar;
